import { Fragment } from "react";
import "./caught.css";

function Caught({ catchList }) {
  console.log("catchList");
  console.log(catchList);
  return (
    <Fragment>
          <div className="topBox">
            <img classname="topIcon" src={typeImage} alt={"icon type"} />
            <img
              classname="topIcon"
              src={searchImage}
              alt={"icon search"}
            />
            <input
              className="input"
              type="text"
              placeholder="Type here your pokemon"
              onChange={ (event) => handlerOnChange(event) }
            ></input>
            <Link to="/home">
              <img classname="topIcon" src={homeImage} alt={"home search"} />
            </Link>
          </div>
      <ul>
        {catchList.map((pokemon) => (
          <li>{pokemon.name}</li>
        ))}
      </ul>
    </Fragment>
  );
}

export default Caught;
